import SkillScale from "./SkillScale";

const mobilePhones = [
    { name: 'Samsung Galaxy', id: 1, batteryHours: 24 },
    { name: 'Nokia 3310', id: 2,  batteryHours: 68  },
    { name: 'Blackberry XZ', id: 3, batteryHours: 20 },
];

function ShoppingList() {
    const smartphones = mobilePhones.map(mobilePhone => 
        <div key={mobilePhone.id} className="product__smartphone">
            <li>{mobilePhone.name}</li>
            <p><SkillScale skillType='batteryHours' scaleValue={mobilePhone.batteryHours} />{mobilePhone.batteryHours}</p>
        </div>
    );

    return (
        <div>
            <h1>Produits</h1>
            <ul>{smartphones}</ul>

        </div>
    );
}

export default ShoppingList;
